      {columnData.map((columns,index)=>(
        <tr>
        <td>{columns[index]=== 'artwork'? <img src= "columns[index] " /> : columns[index]}</td>
        </tr>
      ))}


    </tbody>
</Table>
  )
}

export default Tables;
